    // using `interface` is also ok
    message?: string;
  };
  type MyState = {
    count: number; // like this
  };
  class Home extends React.Component<MyProps, MyState> {
    state: MyState = {
      // optional second annotation for better type inference
      count: 0,
    };
    render() {
      return (
        <>  
          <Header/>
          <SliderArea/>
      </>
      );
    }
  }

  export default Home;
